export const initial_data = [
{
    id: 1,
    date: "1-3-2026",
    description: "I woke up tired for some reason. I think it was because I was on my phone for over an hour before going to sleep. I felt stressed about not getting the work I wanted to get done in the morning. I had brunch with my family and that made me happy."
}, 
{
    id: 2,
    date: "1-4-2026",
    description: "I met my friend Eric and I was frustrated by his attitude with reading. I put this anger on my mom and I felt very bad."
}, 
{
    id : 3,
    date: "1-5-2026",
    description: "I ate lots of Korean food today. I feel very happy."
}
]
